import React from 'react';
import {Link} from 'react-router-dom'
import './css/Home.css'

class Home extends React.Component {
  state = {
    checkLogPas: false
  }
  signOut = (field) => event => {
    this.setState({ [field]: false })
    delete localStorage["token"]
  }
  render () {
    return (
      <div className="Home">
        <div className="sideBar">
        <Link to="/auth" checked={this.state.checkLogPas} onClick={this.signOut("checkLogPas")}>Home</Link>
        </div>
        <div className="body">
        </div>
      </div>
    )
  }
}

export default Home;
